import ReactTable ,{ useTable } from 'react-table'

import { COLUMNS } from './ComponentSearch/DataColumns'


function Search() {
    const columns = useMemo(() => COLUMNS, [])
    const [data, setData] = useState('')

    const Data = useMemo(() => setData ,[])
    useEffect(() => {
        fetch('http://localhost:3001/api/get')
        .then((response) => response.json())
        .then((json) => setData(json))
    },[]);
    
    const tableInstance = useTable({
        COLUMNS,
        data
    })

    const {
        getTableProps,
        getTableBodyProps,
        headerGroups,
        footerGroups,
        rows,
        prepareRow
      } = useTable({
        columns,
        data
      })


    return (
        <div>
            <div>
                <table {...getTableProps}>
                    <thead>
                        <tr>
                            <th>
                                
                            </th>
                        </tr>
                    </thead>
                </table>
                <tbody {...getTableBodyProps}>
                    <tr>
                        <td>

                        </td>
                    </tr>
                </tbody>
            </div>
        </div>
    )
}

export default Search
